    species. However, their life histories diverge - with steelhead undertaking an anadromous
    life cycle whereas rainbow trout reside in freshwater. This difference in life history
    is thought to have some genetic basis, as well as non-genetic causes. This project
    explores genetic basis of steelhead migration and life history.nnGenetic basis of
